text:
Amanda
@mcallister1
Great to see 150 participants of the @E_N_O Breathe programme at the La Boheme dress rehearsal today. Pretty sure it was them laughing when Mimi said she got out of breath going upstairs.  Great show! Wonderful cast and band, lovely set.

@robotmaths 'I watered my plant twice a week
I knew I would transplant it down by the creek. '

And McGonnagal gets a bad press
